import React from "react";
import { UrlWithStringQuery } from "url";

interface AlertType {
  alertType: string;
  title: string;
  text: string;
}

const Alert: React.FC<AlertType> = ({ alertType = 'success', title, text }) => {
  return (
    <div className={`alert alert-${alertType}text-center mb-5`} role="alert">
      <h3>{title}</h3>
    </div>
  );
};

export default Alert;
